import './ContactInfo.css'
const contactInfo = {
    location: 'Getafe  c/ Nombre calle principal calle Secundaria  nº 00 '
    , tlf: '0123456789'
    , links: {
        facebook: 'www.facebook.com'
        , instagram: 'www.instagram.com'
        , booksy: 'www.booksy.com'

    }
    , schedule: [
        {
            time: 'Lunes - Viernes'
            , hours: '08:00 - 20:00'
        }
        , {
            time: 'Sabado'
            , hours: '08:00 - 20:00'
        }
        , {
            time: 'Domingo'
            , hours: '08:00 - 20:00'
        }
    ]

}


const ContactInfo = () => {
    return (
        <div className='contactInfoContainer' >
            <h2>CONTACTO</h2>
            <div className='contactInfo'>
                <h1 className ='info title'>MARIBEL NAILS </h1>
                <div className='info info1'>
                    <div className=''>
                        <h2>VISITANOS</h2>
                        <span id ='info__location-icon' />
                        <p id='info__location'>{contactInfo.location}</p>
                    </div>

                    <div className=''>
                        <h2>LLAMANOS O ESCRIBENOS</h2>
                        <p id='info__tlf'>{contactInfo.tlf}</p>

                    </div>
                </div>

                <div className='info info2 infoShedule'>
                    <h2>HORARIO</h2>
                    
                    {
                        contactInfo.schedule.map((item, index) => {
                            return (
                                <div className='scheduleInfo' key={index} >
                                    <h3>{item.time}</h3>
                                    <p>{item.hours}</p>
                                </div>
                            )
                        })
                    }
                </div>

                <div className='info socialMedia'>
                    <h2>¡SIGENOS EN REDES!</h2>
                    <p>HERE GO 3 ICONS OF IG, FB, BOOKSY</p>
                    
                </div>

            </div>

        </div>
    )
}

export default ContactInfo;
